DROP DATABASE IF EXISTS ProducaoConsumo;

CREATE DATABASE ProducaoConsumo;

USE ProducaoConsumo;

CREATE TABLE Consumo (
    data_registro DATE NOT NULL,
    linha_producao TINYINT NOT NULL,
    consumo_turno1 DOUBLE NOT NULL DEFAULT 0,
    consumo_turno2 DOUBLE NOT NULL DEFAULT 0,
    consumo_turno3 DOUBLE NOT NULL DEFAULT 0,
    consumo_un_turno1 DOUBLE NOT NULL DEFAULT 0,
    consumo_un_turno2 DOUBLE NOT NULL DEFAULT 0,
    consumo_un_turno3 DOUBLE NOT NULL DEFAULT 0,
    CONSTRAINT consumo_pk PRIMARY KEY (data_registro, linha_producao)
);

CREATE TABLE Producao (
	data_registro DATE NOT NULL,
    linha_producao TINYINT NOT NULL,
    producao_turno1 DOUBLE NOT NULL DEFAULT 0,
    producao_turno2 DOUBLE NOT NULL DEFAULT 0,
    producao_turno3 DOUBLE NOT NULL DEFAULT 0,
    FOREIGN KEY (data_registro, linha_producao) REFERENCES Consumo(data_registro, linha_producao)
);


CREATE TABLE ObjetivoConsumoMax (
	data_registro DATE NOT NULL,
    linha_producao TINYINT NOT NULL,
    objetivo1 DOUBLE NOT NULL DEFAULT 0,
    objetivo2 DOUBLE NOT NULL DEFAULT 0,
    objetivo3 DOUBLE NOT NULL DEFAULT 0,
    desperdicio_turno1 DOUBLE NOT NULL DEFAULT 0,
    desperdicio_turno2 DOUBLE NOT NULL DEFAULT 0,
    desperdicio_turno3 DOUBLE NOT NULL DEFAULT 0,
    FOREIGN KEY (data_registro, linha_producao) REFERENCES Consumo(data_registro, linha_producao)
);

